import React from 'react'
import { burger } from '../assets'
import { menuList } from '../constants'

const Menu = () => {
  return (
    <div className='p-10'>
    <div className='card--shadow grid grid-col-5'>

     {menuList.map((menuList) => (<div>
      <img src = {menuList.image} alt="burger" className='p-4 rounded-3xl'></img>
      <h3>{menuList.item}</h3>
      </div>))}
      </div>


    </div>
  )
}

export default Menu
